import React from "react";

import Post from "./Post";

const PostList = ({ posts, users, comments }) => {
  return (
    <table>
      <thead>
        <tr>
          <th>Post Title</th>
          <th>Body of the post</th>
          <th>Authors data</th>
          <th>Other information</th>
        </tr>
      </thead>
      <tbody>
        {posts.map(post => (
          <tr>
            <Post key={post.id} post={post} />
          </tr>
        ))}
      </tbody>
    </table>
  );
};

export default PostList;
